window.bookSummaryJSON = "<p>To save a kingdom, she must charm a monster.</p> <p>Transported to the magical realm of Avalon, Gwen finds herself in the hands of its dark and beautiful ruler—Mordred, the prince in iron.</p> <p>The prince holds total power in Avalon, trapping his rivals in an enchanted crystal prison. But he shows a strange gentleness to Gwen.</p> <p>Seeing no other way to escape, Gwen strikes a deal with Mordred’s enemy. If she can break the crystal, she will be free to go home.</p> <p>Gwen joins Mordred’s court with a plan to steal his heart and destroy his prize.</p> <p>Desire sparks between them at once. But Mordred is a dangerous host. As they draw closer, his passion and anger burn brighter.</p> <p>Gwen would be foolish to trust him. </p> <p>And even more foolish to betray his trust....</p> <p>A gripping dark fairy tale and a seductive fantasy romance with slow-burning attraction, enemies-to-lovers banter, and an alluring villain. The Iron Crystal series will enchant fans of Sarah J. Maas, Elisa Kova, and Danielle L. Jensen.</p>"; 
